<!doctype html>
<html lang="en">
<head>
    <title>Admin Panel - Toffee</title>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <link rel="icon" href="https://toffeelive.com/logo.svg" />
    <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.3/dist/css/bootstrap.min.css" />
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.6.0/css/all.min.css" />
    <style>
        body {
            font-family: "Montserrat", sans-serif;
            background-color: #F5F5F5; /* Light background */
            color: #333; /* Dark text color */
            padding: 20px;
        }
        h1, h5 {
            color: #333; /* Consistent header color */
        }
        .card {
            background-color: #FFFFFF; /* White card background */
            border: 1px solid #E0E0E0; /* Card border */
            border-radius: 1rem;
            margin-bottom: 20px;
            box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1); /* Subtle shadow */
        }
        .btn-danger {
            background-color: #FF6347; /* Button color */
            border-color: #FF6347; /* Button border */
        }
        .btn-danger:hover {
            background-color: #FF4500; /* Button hover color */
        }
        .list-group-item {
            background-color: #FFFFFF; /* White list item background */
            border: 1px solid #E0E0E0; /* List item border */
            border-radius: 0.5rem; /* Rounded corners */
            margin-bottom: 10px; /* Spacing between items */
            color: #333; /* Dark text color */
            transition: background-color 0.3s; /* Smooth transition for hover effect */
        }
        .list-group-item:hover {
            background-color: #F8F9FA; /* Slightly lighter on hover */
        }
        .alert {
            background-color: #D1ECF1; /* Light alert background */
            color: #0C5460; /* Dark alert text */
        }
        .float-end {
            margin-left: 10px; /* Spacing for buttons */
        }
        .channel-logo {
            width: 50px; /* Fixed width for the logo */
            height: 50px; /* Fixed height for the logo */
            object-fit: cover; /* Maintain aspect ratio */
            border-radius: 0.5rem; /* Rounded corners for the logo */
        }
        /* Additional styling for form elements */
        .form-control {
            background-color: #FFFFFF; /* White background for inputs */
            border: 1px solid #CED4DA; /* Input border color */
            color: #333; /* Input text color */
        }
        .form-control:focus {
            background-color: #FFFFFF; /* Keep white background on focus */
            border-color: #FF6347; /* Highlight border color on focus */
            box-shadow: none; /* Remove shadow */
        }
        .form-label {
            color: #333; /* Label color */
        }
        /* Style for buttons inside list items */
        .list-group-item .btn-danger {
            margin-top: -5px; /* Adjust vertical alignment */
        }
    </style>
</head>
<body>
    <div class="container">
        <h1 class="my-4">Admin Panel</h1>

        <!-- Form to Add/Update Channel -->
        <div class="card">
            <div class="card-body">
                <h5 class="card-title">Add or Edit Channel</h5>
                <form id="channelForm">
                    <div class="mb-3">
                        <label for="channelId" class="form-label">Channel ID</label>
                        <div class="input-group">
                            <input type="text" class="form-control" id="channelId" readonly>
                            <button type="button" class="btn btn-danger" id="generateIdBtn">Generate</button>
                        </div>
                    </div>
                    <div class="mb-3">
                        <label for="channelName" class="form-label">Channel Name</label>
                        <input type="text" class="form-control" id="channelName" required>
                    </div>
                    <div class="mb-3">
                        <label for="channelLogo" class="form-label">Channel Logo URL</label>
                        <input type="url" class="form-control" id="channelLogo" required>
                    </div>
                    <div class="mb-3">
                        <label for="channelStream" class="form-label">Streaming Link</label>
                        <input type="url" class="form-control" id="channelStream" required>
                    </div>
                    <button type="submit" class="btn btn-danger">Add/Update Channel</button>
                </form>
            </div>
        </div>

        <!-- List of Channels -->
        <h5>Channel List</h5>
        <div id="channelList" class="list-group"></div>
    </div>

    <!-- Firebase Configuration and Initialization -->
